import React from "react";
import styled from "styled-components";

const FooterContainer = styled.div`
    width: 100%;
    background-color: #3FBED3;
    height: 200px;
    padding-left: 30px;
    padding-right: 30px;
    display: flex;
    align-items: center;
`

const Footer = () => {
    return (
        <>
        <FooterContainer>

        </FooterContainer>
        </>
    )
}

export default Footer;
